import { Link } from "react-router-dom"

const DUMMY_EVENTS = [
    {id: '1' , title : 'Event number 1'},
    {id: '2' , title : 'Event number 2'},
    {id: '3' , title : 'Event number 3'},
]

export default function EventsPage(){
    return(
        <main>
            {DUMMY_EVENTS.map(event => (
                <li><Link to={event}></Link></li>
            ))}
        </main>
    )
}
